// Parse the tab-delimited data
const data = d3.tsvParse(rawData.replace(/ /g, ""), d3.autoType);

// Extract the stack keys (all columns except X)
const stackKeys = Object.keys(data[0]).filter(d => d !== "X");

// Chart dimensions and margins
const width = 800, height = 500;
const margin = {top: 40, right: 150, bottom: 80, left: 60};
  
// Create SVG container
const svg = d3.select("#d3Chart")
  .append("svg")
  .attr("width", width)
  .attr("height", height)
  .attr("viewBox", [0, 0, width, height])
  .attr("style", "max-width: 100%; height: auto;");

// Prepare data for stacking
const series = d3.stack()
  .keys(stackKeys)
  .order(d3.stackOrderNone)
  .offset(d3.stackOffsetNone)(data);

// X scale (convert X values to positions)
const x = d3.scaleBand()
  .domain(data.map(d => d.X))
  .range([margin.left, width - margin.right])
  .padding(0.2);

// Y scale (convert values to positions)
const y = d3.scaleLinear()
  .domain([0, d3.max(series, layer => d3.max(layer, d => d[1])) * 1]) // Add 5% padding
  .nice()
  .range([height - margin.bottom, margin.top]);

// Cores personalizadas para cada percentil
const coresPersonalizadas = [
  "#2ca02c",  // P_5Y - verde
  "#98df8a",  // P_10Y - verde claro
  "#d62728",  // P_25Y - vermelho
  "#ff9896",  // P_50Y - vermelho claro
  "#1f77b4",  // P_75Y - azul
  "#aec7e8",  // P_90Y - azul claro
  "#9467bd"   // P_95Y - roxo
];

// Escala de cores para as sries
const cor = d3.scaleOrdinal()
  .domain(chavesEmpilhamento)
  .range(coresPersonalizadas);

// Create stacked bars
svg.selectAll("g.layer")
  .data(series)
  .enter()
  .append("g")
  .attr("class", "layer")
  .attr("fill", d => color(d.key))
  .selectAll("rect")
  .data(d => d)
  .enter()
  .append("rect")
  .attr("x", d => x(d.data.X))
  .attr("y", height - margin.bottom)
  .attr("width", x.bandwidth())
  .attr("height", 0)
  .transition()
  .delay((d, i) => i * 1)
  .duration(800)
  .attr("y", d => y(d[1]))
  .attr("height", d => y(d[0]) - y(d[1]));

// Add X axis
svg.append("g")
  .attr("transform", `translate(0,${height - margin.bottom})`)
  .call(d3.axisBottom(x).tickFormat(d3.format(".3f")))
  .selectAll("text")
    .attr("transform", "rotate(-45)")
    .style("text-anchor", "end")
    .attr("dx", "-0.5em")
    .attr("dy", "0.5em");

// Add X axis label
svg.append("text")
  .attr("transform", `translate(${width / 2},${height - margin.bottom / 3})`)
  .style("text-anchor", "middle")
  .text("X Value");

// Add Y axis
svg.append("g")
  .attr("transform", `translate(${margin.left},0)`)
  .call(d3.axisLeft(y));

// Add Y axis label
svg.append("text")
  .attr("transform", "rotate(-90)")
  .attr("y", margin.left / 3)
  .attr("x", -height / 2)
  .style("text-anchor", "middle")
  .text("Clearence");

// Add legend
const legend = svg.append("g")
  .attr("transform", `translate(${width - margin.right + 30}, ${margin.top})`);
  
legend.selectAll("rect")
  .data(series)
  .enter()
  .append("rect")
  .attr("x", 0)
  .attr("y", (d, i) => i * 20)
  .attr("width", 15)
  .attr("height", 15)
  .attr("fill", d => color(d.key));
  
legend.selectAll("text")
  .data(series)
  .enter()
  .append("text")
  .attr("x", 20)
  .attr("y", (d, i) => i * 20 + 12)
  .text(d => d.key)
  .style("font-size", "12px")
  .attr("alignment-baseline", "middle");

// Add chart title
svg.append("text")
  .attr("x", width / 2)
  .attr("y", margin.top - 10)
  .attr("text-anchor", "middle")
  .style("font-size", "16px")
  .style("font-weight", "bold")
  .text("Stacked Bar Chart of Percentile Distribution");
